import styled from "styled-components";

export const Container = styled.aside`
  justify-items: center;
  align-items: center;
  height: 100vh;
  width: 100%;
  flex-direction: column;
  background-color: #191923;
  display: flex;
  z-index: 1;
  section {
    display: flex;
    gap: 30px;
    flex-direction: row;
  }
  .boxAll {
    width: 90%;
    justify-items: center;
    align-items: center;
    display: flex;
    overflow-y: scroll;
    background-color: #191923;
    z-index: 1;
  }
`;
